import React from "react";
import { connect } from "react-redux";
import { NavLink } from "react-router-dom";
import {
  defaultRoute,
  settingsRoute,
  profiledRoute,
  dashboardRoute,
  loginRoute
} from "../../config/route";
const Header = props => {
  console.log("Header%%%%%%%%%%%%%%%%%");
  const renderLogin = props => {
    if (props.isLogin) {
      return <NavLink to={loginRoute}>Login</NavLink>;
    } else {
      return (
        <React.Fragment>
          <NavLink to={defaultRoute}>Profile</NavLink>
          <NavLink to={settingsRoute}>Setting</NavLink>
          <NavLink to={dashboardRoute}>Dashboard</NavLink>
          <NavLink to={loginRoute}>Logout</NavLink>
        </React.Fragment>
      );
    }
  };

  return <header className="header">{renderLogin()}</header>;
};

const mapStateToProps = state => {
  return { isLogin: state.authentication.isSessionActive };
};

export default connect(mapStateToProps)(Header);
